import React from "react";

import "./CustomDivider.scss";

const CustomDivider = () => {
  return (
    <div class="divider">
        <h2></h2>
      <div class="filter-gradient">
        <div class="filter-black">
        </div>
      </div>
    </div>
  );
};

export default CustomDivider;
